let currDate = new Date();
let greet = " ";

if(currDate>=0 && currDate<=12){
   greet = "Good Morning";
}
else if(currDate>12 && currDate<=16){
    greet = "Good Afternoon";
}
else if(currDate>16 && currDate<=24){
    greet = "Good Evening";
}else{
    greet = "Good Night";
}

document.write(currDate);

function App(){
    return <div>
            <h1>Hellow Sir , {greet} </h1>
    </div>
}


export default App;
